import React from 'react';
import '../css/Services.css'; // Asegúrate de que la ruta sea correcta

const Services = () => {
  return (
    <section id="services" className="services">
      <h2>Servicios</h2>
      <div className="service-list">
        <div className="service-item">
          <h3>Construcción de Viviendas</h3>
          <p>Construimos tu casa ideal con materiales de alta calidad.</p>
        </div>
        <div className="service-item">
          <h3>Domótica Inteligente</h3>
          <p>Instalamos sistemas domóticos para un hogar más eficiente y seguro.</p>
        </div>
        <div className="service-item">
          <h3>Reformas y Remodelaciones</h3>
          <p>Transformamos tu espacio para que se ajuste a tus necesidades.</p>
        </div>
      </div>
    </section>
  );
};

export default Services;
